import React, { Component } from 'react';
import './App.css';

import Nav from "./Nav";
import TodoService from "./TodoService";

class App extends Component {
  render() {
    return (
      <div className="App">
        Enter your name and hobby here.
        <TodoService />
        <button>Hobbies list<Link className="navButton" to={{pathname: `/hobbiesList`}}>Search Canyons</Link></button>
      </div>
    );
  }
}

export default App;
